import React, { useState, useEffect } from 'react';

function EventsList() {
   const [users, setUsers] = useState([]);

    useEffect(() => {
        console.log("Well u did something");
        const response = fetch('/');
        const body = response.json;
        setUsers(body);
    }, []);

    return(
        <div>
            {users.map(user =>
                <div key={user.UID}>
                    {user.UID} ({user.firstName})
                </div>
            )}
        </div>
    )
}
export default EventsList
